:
use the `java.util.Scanner.`.hasNextLine()` on a Scanner object to determine whether the Scanner is at the end of the File object.

and use `java.util.Scanner.nextLine()` to consume the last line and return the next line to it.

like this:
Scanner in = new Scanner(new File("//vats.txt"));
while (in.hasNextLine()){
    String line = in.nextLine();
    String[] lines = line.split("\\s");
    System.out.println(lines[1]);
}

